def alpha_beta_pruning(board, depth, alpha, beta, is_maximizing):
    # Base case: terminal state atau depth limit tercapai
    winner = check_winner(board)
    if winner is not None or depth == 0:
        return evaluate(board, depth)

    if is_maximizing:
        max_eval = -math.inf
        for move in get_available_moves(board):
            make_move(board, move, 'X')
            eval = alpha_beta_pruning(board, depth-1, alpha, beta, False)
            undo_move(board, move)
            max_eval = max(max_eval, eval)
            alpha = max(alpha, eval)
            if beta <= alpha:
                break  # Beta pruning
        return max_eval
    else:
        min_eval = math.inf
        for move in get_available_moves(board):
            make_move(board, move, 'O')
            eval = alpha_beta_pruning(board, depth-1, alpha, beta, True)
            undo_move(board, move)
            min_eval = min(min_eval, eval)
            beta = min(beta, eval)
            if beta <= alpha:
                break  # Alpha pruning
        return min_eval

