def evaluate(board):
    # Nilai Material (dalam pawn)
    material = sum(piece_values[p] for p in board.pieces)

    # Mobilitas
    mobility = len(list(board.legal_moves)) * 0.1

    # Kontrol Pusat
    center = sum(1 for sq in [chess.E4, chess.E5, chess.D4, chess.D5]
                 if board.is_attacked_by(chess.WHITE, sq)) * 0.3

    # Keamanan Raja
    king_safety = pawn_shield_count(board) * 0.5

    return material + mobility + center + king_safety

