"""Implementasi Backward Chaining"""

def backward_chaining(knowledge_base, goal, known_facts):
    if goal in known_facts:
        return True

    for rule in knowledge_base:
        premises, conclusion = rule
        if conclusion == goal:
            all_premises_proven = True
            for p in premises:
                if not backward_chaining(knowledge_base, p, known_facts):
                    all_premises_proven = False
                    break
            if all_premises_proven:
                return True
    return False

