"""Optimasi Algoritma Inferensi

a. Rete Algorithm

Digunakan dalam sistem produksi besar untuk efisiensi:
"""

class ReteNode:
    def __init__(self):
        self.children = []
        self.items = set()

    def activate(self, item):
        if item not in self.items:
            self.items.add(item)
            for child in self.children:
                child.activate(item)

class AlphaNode(ReteNode):
    def __init__(self, condition):
        super().__init__()
        self.condition = condition

class BetaNode(ReteNode):
    def __init__(self, left, right):
        super().__init__()
        self.left = left
        self.right = right
        left.children.append(self)
        right.children.append(self)

"""b. Conflict Resolution Strategies

Untuk sistem berbasis aturan:
"""

def resolve_conflicts(activated_rules):
    # 1. Prioritaskan rule dengan spesifisitas lebih tinggi
    activated_rules.sort(key=lambda r: -len(r[0]))

    # 2. Recency (FIFO)
    return activated_rules[0] if activated_rules else None

"""Algoritma inferensi merupakan tulang punggung berbagai sistem cerdas modern, dari diagnosis medis hingga rekomendasi produk. Pemilihan algoritma yang tepat (forward/backward chaining, probabilistik, dll.) tergantung pada karakteristik masalah dan kebutuhan performa.

### Penjelasan Mendalam

Teori Dasar Inferensi Logika

a. Semantik Formal
Algoritma inferensi bekerja berdasarkan
kalkulus proposisional:

- Modus Ponens: Jika P → Q dan P benar, maka Q benar

- Resolusi: (P ∨ Q) ∧ (¬P ∨ R) ⇒ (Q ∨ R)

b. Kompleksitas Komputasi

![image.png](data:image/png;base64,)

Implementasi Optimasi Rete Algorithm
"""

class ReteNetwork:
    def __init__(self):
        self.alpha_memory = {}
        self.beta_memory = {}
        self.productions = []

    def add_rule(self, conditions, action):
        # Build alpha nodes
        alpha_nodes = []
        for cond in conditions:
            if cond not in self.alpha_memory:
                self.alpha_memory[cond] = AlphaNode(cond)
            alpha_nodes.append(self.alpha_memory[cond])

        # Build beta nodes
        if len(alpha_nodes) == 1:
            join_node = alpha_nodes[0]
        else:
            join_node = BetaNode(alpha_nodes[0], alpha_nodes[1])
            for node in alpha_nodes[2:]:
                join_node = BetaNode(join_node, node)

        # Add production node
        prod_node = ProductionNode(action)
        join_node.children.append(prod_node)
        self.productions.append(prod_node)

    def assert_fact(self, fact):
        for cond, node in self.alpha_memory.items():
            if matches_condition(fact, cond):
                node.activate(fact)

def matches_condition(fact, condition):
    # Implement pattern matching
    return fact.lower() == condition.lower()

