import numpy as np

def mcmc_inference(bayesian_net, evidence, iterations=10000):
    samples = []
    current = {node: np.random.choice([True, False]) for node in bayesian_net.nodes}

    for _ in range(iterations):
        for node in bayesian_net.topological_order():
            if node in evidence:
                current[node] = evidence[node]
                continue

            # Hitung probabilitas bersyarat
            parents = bayesian_net.get_parents(node)
            parent_values = [current[p] for p in parents]
            p_true = bayesian_net.get_probability(node, parent_values, True)

            # Sampling
            current[node] = np.random.random() < p_true

        samples.append(current.copy())

    return samples

