def fuzzy_forward_chaining(symptoms, threshold=0.7):
    inferred = {}
    agenda = [(sym, 1.0) for sym in symptoms]
    
    while agenda:
        fact, conf = agenda.pop(0)
        if fact not in inferred or conf > inferred[fact]:
            inferred[fact] = conf
            for (antecedents, (consequent, rule_conf)) in medical_rules:
                min_conf = min(conf * c for (_, c) in antecedents)
                if min_conf >= threshold:
                    new_conf = min_conf * rule_conf
                    agenda.append((consequent, new_conf))
    
    return inferred

