class IncrementalInferenceEngine:
    def __init__(self):
        self.dependency_graph = defaultdict(set)
        self.fact_dependents = defaultdict(set)
        self.known_facts = set()

    def add_rule(self, premises, conclusion):
        self.dependency_graph[frozenset(premises)].add(conclusion)
        for p in premises:
            self.fact_dependents[p].add(frozenset(premises))

    def add_fact(self, fact):
        if fact in self.known_facts:
            return
        self.known_facts.add(fact)

        for premises in self.fact_dependents.get(fact, []):
            if premises.issubset(self.known_facts):
                for conclusion in self.dependency_graph[premises]:
                    self.add_fact(conclusion)

