"""Algoritma inferensi modern menggabungkan teknik simbolik klasik dengan pendekatan probabilistik dan machine learning. Pemahaman mendalam tentang kompleksitas algoritmik dan karakteristik problem sangat penting dalam memilih implementasi yang optimal untuk kasus penggunaan tertentu.

## Model Checking

Model checking adalah teknik verifikasi formal untuk memeriksa apakah model sistem memenuhi spesifikasi tertentu.

Konsep Dasar

Komponen Utama:
- Model Sistem: Representasi formal sistem (biasanya sebagai Kripke Structure)

- Spesifikasi: Properti yang akan diverifikasi (dalam logika temporal seperti LTL atau CTL)

- Checker: Algoritma yang memverifikasi model terhadap spesifikasi

Jenis Logika Temporal:
- LTL (Linear Temporal Logic): Mengevaluasi jalur eksekusi tunggal

- CTL (Computation Tree Logic): Mengevaluasi pohon komputasi

Implementasi
"""

from itertools import product

class KripkeStructure:
    def __init__(self, states, transitions, labels):
        self.states = states
        self.transitions = transitions  # Dict: state -> set of next states
        self.labels = labels  # Dict: state -> set of atomic propositions

class ModelChecker:
    def __init__(self, kripke_structure):
        self.ks = kripke_structure

    def check_CTL(self, formula):
        # Parser CTL sederhana
        if formula[0] == 'AX':
            return self.check_AX(formula[1])
        elif formula[0] == 'EX':
            return self.check_EX(formula[1])
        elif formula[0] == 'AG':
            return self.check_AG(formula[1])
        elif formula[0] == 'EG':
            return self.check_EG(formula[1])
        elif formula[0] == 'AF':
            return self.check_AF(formula[1])
        elif formula[0] == 'EF':
            return self.check_EF(formula[1])
        else:
            return self.check_atomic(formula)

    def check_AX(self, phi):
        # Semua next state memenuhi phi
        satisfying_states = set()
        for s in self.ks.states:
            all_next_satisfy = True
            for next_s in self.ks.transitions.get(s, set()):
                if next_s not in self.check_CTL(phi):
                    all_next_satisfy = False
                    break
            if all_next_satisfy:
                satisfying_states.add(s)
        return satisfying_states

    def check_EX(self, phi):
        # Ada next state yang memenuhi phi
        satisfying_states = set()
        phi_states = self.check_CTL(phi)
        for s in self.ks.states:
            for next_s in self.ks.transitions.get(s, set()):
                if next_s in phi_states:
                    satisfying_states.add(s)
                    break
        return satisfying_states

    def check_AG(self, phi):
        # Selalu (globally) memenuhi phi
        phi_states = self.check_CTL(phi)
        return self.fixpoint(lambda S: S & phi_states)

    def check_EG(self, phi):
        # Ada path yang selalu memenuhi phi
        phi_states = self.check_CTL(phi)
        return self.fixpoint(lambda S: phi_states & set(
            s for s in self.ks.states
            if any(ns in S for ns in self.ks.transitions.get(s, set()))
        ))

    def fixpoint(self, func):
        # Hitung fixed point
        S = set(self.ks.states)
        while True:
            new_S = func(S)
            if new_S == S:
                return S
            S = new_S

