import numpy as np

class MarkovDecisionProcess:
    def __init__(self, states, transitions, rewards, labels):
        self.states = states
        self.transitions = transitions  # Dict: (state,action) -> {state: prob}
        self.rewards = rewards          # Dict: state -> reward
        self.labels = labels            # Dict: state -> set of labels

class ProbabilisticModelChecker:
    def __init__(self, mdp):
        self.mdp = mdp

    def check_PCTL(self, formula, tolerance=1e-6):
        if formula[0] == 'Pmax':
            return self.max_probability(formula[1])
        elif formula[0] == 'Pmin':
            return self.min_probability(formula[1])

    def max_probability(self, phi):
        # Value iteration untuk menghitung probabilitas maksimal
        V = {s: 0 for s in self.mdp.states}
        while True:
            new_V = {}
            delta = 0
            for s in self.mdp.states:
                if s in self.satisfying_states(phi):
                    new_V[s] = 1
                else:
                    max_val = 0
                    for a in self.mdp.actions(s):
                        val = sum(p * V[s_prime] for s_prime, p in self.mdp.transitions(s,a).items())
                        max_val = max(max_val, val)
                    new_V[s] = max_val
                delta = max(delta, abs(new_V[s] - V[s]))
            V = new_V
            if delta < tolerance:
                break
        return V

