def stubborn_sets(model, state):
    # Identifikasi transisi independen yang bisa dikurangi
    stubborn = set()

    # Tambahkan semua transisi yang memengaruhi variabel dalam properti
    if 'critical1' in model.labels[state]:
        stubborn.add('enter1')
        stubborn.add('exit1')

    # Pastikan minimal satu transisi enabled ada dalam stubborn set
    enabled = model.enabled_transitions(state)
    if not stubborn & enabled:
        stubborn.add(next(iter(enabled)))

    return stubborn

