def solve_riddle(clue):
    rules = {
        "bisa tumbuh": ["api", "tumbuhan", "kristal"],
        "butuh udara": ["api", "layang-layang"],
        "bukan makhluk hidup": ["api", "angin", "air"]
    }

    # Cari kata yang memenuhi semua constraints
    from collections import defaultdict
    candidate_scores = defaultdict(int)

    for keyword, possible_answers in rules.items():
        for ans in possible_answers:
            if keyword in clue.lower():
                candidate_scores[ans] += 1

    # Ambil jawaban dengan skor tertinggi
    best_answer = max(candidate_scores, key=candidate_scores.get)
    return best_answer

