class RiddleSolver:
    def __init__(self):
        self.riddle_db = {
            "api": ["tumbuh", "udara", "bukan hidup", "merah", "panas"],
            "waktu": ["berjalan", "tidak kembali", "angka", "siang", "malam"],
            "bayangan": ["mengikuti", "gelap", "cahaya", "bentuk"]
        }
        self.vectorizer = TfidfVectorizer()

    def semantic_similarity(self, clue, answer):
        doc1 = nlp(clue)
        doc2 = nlp(" ".join(self.riddle_db[answer]))
        return doc1.similarity(doc2)

    def solve(self, clue):
        scores = {}
        for answer in self.riddle_db:
            scores[answer] = self.semantic_similarity(clue, answer)
        return max(scores, key=scores.get)

