"""Optimasi Backtracking dengan MRV (Minimum Remaining Values)"""

def backtracking_with_heuristics(csp, assignment={}):
    if len(assignment) == len(csp.variables):
        return assignment

    # Pilih variabel dengan domain tersempit
    unassigned = [v for v in csp.variables if v not in assignment]
    next_var = min(unassigned, key=lambda v: len(csp.domains[v]))

    for value in csp.domains[next_var]:
        local_assignment = assignment.copy()
        local_assignment[next_var] = value

        if csp.is_consistent(local_assignment):
            # Forward Checking
            domains_copy = csp.domains.copy()
            for neighbor in get_neighbors(next_var):
                if neighbor not in local_assignment:
                    csp.domains[neighbor] = [d for d in csp.domains[neighbor]
                                           if check_constraints(neighbor, d, local_assignment)]

            result = backtracking_with_heuristics(csp, local_assignment)
            if result is not None:
                return result

            csp.domains = domains_copy
    return None

