import networkx as nx

class MaraudersMap:
    def __init__(self):
        self.graph = nx.Graph()
        self.add_locations()

    def add_locations(self):
        self.graph.add_edges_from([
            ("Gryffindor", "RoomOfRequirement"),
            ("RoomOfRequirement", "Kitchens"),
            ("Kitchens", "Hufflepuff"),
            ("Hufflepuff", "Library"),
            ("Library", "Ravenclaw"),
            ("Ravenclaw", "ForbiddenForest"),
            ("ForbiddenForest", "Slytherin"),
            ("Slytherin", "Dungeons")
        ])

    def find_shortest_path(self, start, end, constraints):
        def is_valid_path(path):
            # Constraint: Melewati lokasi tertentu
            return all(loc in path for loc in constraints["must_visit"])

        all_paths = nx.all_simple_paths(self.graph, start, end)
        valid_paths = filter(is_valid_path, all_paths)
        return min(valid_paths, key=len, default=None)

# Contoh penggunaan
