import gym
from gym import spaces

class GobletOfFireEnv(gym.Env):
    def __init__(self):
        self.action_space = spaces.Discrete(2)  # Pilih kiri/kanan
        self.observation_space = spaces.Dict({
            "cups": spaces.MultiBinary(2),
            "clues": spaces.Text()
        })

    def step(self, action):
        reward = 0
        done = False

        if action == 1:  # Kanan (benar)
            reward = 1
            done = True
        else:            # Kiri (salah)
            reward = -1

        return self._get_obs(), reward, done, {}

    def reset(self):
        return self._get_obs()

